import styled from "styled-components";

const Container = styled.ul`
    width: 100%;
`;

const Item = styled.li`
    width: 100px;
    background-color: aliceblue;
`;

function NavItem() {
    return (
        <Container>
            <Item>task1</Item>
        </Container>
    );
}

export default NavItem;
